import gql from 'graphql-tag';

/* query getCategories($searchText: String, $offset: Int) {
  categories(searchText: $searchText, offset: $offset) {
{limit, offset, searchText}: ICommonPaginationArgs,
 */
export const GET_TYPE= gql`
  query Types($limit: Int, $offset: Int, $searchText: String) {
    types(limit: $limit, offset: $offset, searchText: $searchText) {
      totalCount
        items{
          id
          name
          slug
          image
          icon
          home_title
          home_subtitle
          meta_title
          meta_keyword
          meta_description
        }
    }
  }
`;
